import React, {useState,useEffect, useMemo} from 'react';
import './App.css';
import Whitehat from './Whitehat';
import WhiteHatStats from './WhiteHatStats'
import Blackhat from './Blackhat';
import BlackHatStats from './BlackHatStats';
import * as d3 from 'd3';


function App() {

  const [data, setData] = useState();

  // fetch csv data 
  async function fetchCSV(){
    d3.csv('browsing_history_enhanced.csv').then(d=>{
      // console.log(d);
        setData(d);
    })
  }

  console.log(data);
  // async function fetchHisData(){
  //   fetch('browsing_history_enhanced.csv').then(d => {
  //     console.log(d)
  //     // d.csv().then(gd=>{
  //     //   console.log('Hisdata',gd)
  //     //   // setGunData(gd);
  //     // })
  //   })
  // }

  //fetch data, called only once
  useEffect(()=>{
    fetchCSV();
  },[])

  return (
    <div className="App">
      <div className={'header'}
        style={{'height':'4em','width':'100vw'}}
      >
        <h1>{'Analysis View'}</h1>
      </div>
      <div 
        style={{'height': '43vw','width':'100vw','background': '#eee'}}
      >
        <div className={'body'} 
          style={{'height':'50%','width':'calc(50% - 2em)', 'display':'inline-block', 'background': 'pink'}}
        >
          <h1>{'plot 1'}</h1>
        </div>

        <div className={'body'} 
          style={{'height':'50%','width':'calc(50% - 2em)', 'display':'inline-block', 'background': 'green'}}
        >
          <h1>{'plot 2'}</h1>
        </div>


        <div className={'body'} 
          style={{'height':'50%','width':'calc(50% - 2em)', 'display':'inline-block', 'background': 'blue'}}
        >
          <h1>{'plot 3'}</h1>
        </div>

        <div className={'body'} 
          style={{'height':'50%','width':'calc(50% - 2em)', 'display':'inline-block', 'background': 'purple'}}
        >
          <h1>{'plot 4'}</h1>
        </div>
      </div>
    </div>

  );
}




class ToolTip {
  static moveTTip(tTip, tipX, tipY){
    var tipBBox = tTip.node().getBoundingClientRect();
    while(tipBBox.width + tipX > window.innerWidth){
        tipX = tipX - 10 ;
    }
    while(tipBBox.height + tipY > window.innerHeight){
        tipY = tipY - 10 ;
    }
    tTip.style('left', tipX + 'px')
        .style('top', tipY + 'px')
        .style('visibility', 'visible')
        .style('z-index', 1000);
  }

  static moveTTipEvent(tTip, event){
      var tipX = event.pageX + 30;
      var tipY = event.pageY -20;
      this.moveTTip(tTip,tipX,tipY);
  }


  static hideTTip(tTip){
      tTip.style('visibility', 'hidden')
  }

  static addTTipCanvas(tTip, className, width, height){
      tTip.selectAll('svg').selectAll('.'+className).remove();
      let canvas = tTip.append('svg').attr('class',className)
          .attr('height',height).attr('width',width)
          .style('background','white');
      return canvas
  }
}

export default App;
